import { GetUsernameFromCoockies } from '@/assets/get_username_from_cookies.js'


class SetValuesDiapasonInput {
    constructor (messageCatch){
        this.start_diapason = this.parsingMessage(messageCatch).start_diapason
        this.end_diapason = this.parsingMessage(messageCatch).end_diapason
    }

    parsingMessage (messageCatch) {
        return JSON.parse(messageCatch.message)
    }

    setValue
}


class SetDiapasonToOperator {
    constructor (event) {
        this.headers = {'Content-Type': 'application/json'}
        this.event = event
        this.id = event.target.id
        this.url = `http://127.0.0.1:8000/api/operator_user/define_clients_diapason/`
        this.username = new GetUsernameFromCoockies(document.cookie).findUsernameString()
        this.body = {
            'username': this.username,
            'start_diapason': this.returnDiapason(0),
            'end_diapason': this.returnDiapason(1)
        }
    }

    returnFormData(){
        return document.forms.pagination
    }

    returnDiapason (indexDigit) {
        return this.returnFormData()[indexDigit].value
    }

    testConsoleLog() {
        var dataForm = document.forms.pagination
        var input_start = dataForm.elements[0].value
        var input_end = dataForm.elements[1].value
        console.log(input_start)
        console.log(input_end)
    }

    checkAndSetBody () {
        if (this.body.start_diapason.length !== 0 && this.body.end_diapason.length === 0) {
            this.body = {
                'username': this.username,
                'start_diapason': this.returnDiapason(0),
                'end_diapason': null
            }
        } 
        else if (this.body.start_diapason.length === 0 && this.body.end_diapason.length !== 0) {
            this.body = {
                'username': this.username,
                'start_diapason': null,
                'end_diapason': this.returnDiapason(1)
            }
        }
    }

    sendFetch () {
        return fetch(this.url, {
            method: 'PUT',
            body: JSON.stringify(this.body),
            headers: this.headers
        }).then(response => {
            return response.json()
            })
    }

    setDiapasonToOperator () {
        if ((this.body.start_diapason.length | this.body.end_diapason.length) == 0){
            alert('Нужно указать хотябы одну границу диапазона для вывода клиентов')
            return
        }
        else {
            this.checkAndSetBody()
            this.sendFetch()
        }
    }
}
    

export { SetDiapasonToOperator, SetValuesDiapasonInput};
